webpackJsonp([0xa48b22373167],{392:function(t,a){t.exports={data:{markdownRemark:{html:'<p>Pike提供windows, macos与linux三个版本的执行文件，以及docker镜像</p>\n<p>Pike编译生成的执行文件可在项目主页<a href="https://github.com/vicanso/pike">pike</a>中的<a href="https://github.com/vicanso/pike/releases">releases</a>中下载您需要的版本。</p>\n<p>推荐大家使用已打包好的docker镜像(不到20MB）的形式，只需要以下简单的几步则可:</p>\n<div class="gatsby-highlight">\n      <pre class="gatsby-code-bash"><code>docker pull vicanso/pike\n\ndocker -d --restart<span class="token operator">=</span>always -p 3015:3015 -v ./config.yml:/etc/pike/config.yml vicanso/pike\n</code></pre>\n      </div>',frontmatter:{title:"安装",next:"config.html",prev:"how-to-start.html"},fields:{path:"docs/installation.md",slug:"docs/installation.html"}}},pathContext:{slug:"docs/installation.html"}}}});
